	@import url("https://fonts.googleapis.com/css2?family=Pacifico&display=swap");
	body {
	  background: -webkit-gradient(linear, left top, right top, from(#ffafbd), to(#ffc3a0));
	  background: linear-gradient(to right, #ffafbd 0%, #ffc3a0 100%);
	  font-family: 'Pacifico', cursive;
	  min-height: 100vh;
	  display: -webkit-box;
	  display: flex;
	  -webkit-box-orient: vertical;
	  -webkit-box-direction: normal;
	  flex-direction: column;
	  -webkit-box-pack: center;
	  justify-content: center;
	  -webkit-box-align: center;
	  align-items: center;
	}

	.eyes {
	  -webkit-animation: move 2s forwards infinite;
	  animation: move 2s forwards infinite;
	}

	@-webkit-keyframes move {
	  0% {
	    -webkit-transform: translateX(0%);
	  }
	  20% {
	    -webkit-transform: translate(4px, -4px);
	  }
	  40% {
	    -webkit-transform: translate(6px, -4px);
	  }
	  60% {
	    -webkit-transform: translate(12px, 0px);
	  }
	  80% {
	    -webkit-transform: translate(6px, 6px);
	  }
	  100% {
	    -webkit-transform: none;
	  }
	}
	@keyframes move {
	  0% {
	    -webkit-transform: translateX(0%);
	            transform: translateX(0%);
	  }
	  20% {
	    -webkit-transform: translate(4px, -4px);
	            transform: translate(4px, -4px);
	  }
	  40% {
	    -webkit-transform: translate(6px, -4px);
	            transform: translate(6px, -4px);
	  }
	  60% {
	    -webkit-transform: translate(12px, 0px);
	            transform: translate(12px, 0px);
	  }
	  80% {
	    -webkit-transform: translate(6px, 6px);
	            transform: translate(6px, 6px);
	  }
	  100% {
	    -webkit-transform: none;
	            transform: none;
	  }
	}
	div:before, div:after {
	  content: "4";
	  font-size: 200px;
	}

	p {
	  text-align: center;
	  font-size: 50px;
	  margin-top: -10px;
	}

	.kitty {
	  font-weight: bold;
	  font-size: 50px;
	}

	  text-decoration: none;
	  padding: .75em 2em;

	  -webkit-transition: all 300ms ease-out;
	  transition: all 300ms ease-out;
	}

	a:hover {
	  box-shadow: 0px 0px 0px 2px #00897B inset, 0px 0px 0px 4px white inset;
	}

	.a:active {
	  -webkit-transform: scale(0.9);
	          transform: scale(0.9);
	}
